,'Áo Khoác Len Dáng Ngắn',784000,'ao-khoac-len-dang-ngan-4',4),(5,'2024-10-30 19:48:25.745582','admin@gmail.com','2024-10-30 19:48:25.780732','admin@gmail.com',NULL,NULL,'- Polyester-cotton fabric, specially coated for a glossy finish.\n- Nylon hood stows away inside the collar.\n- Long, oversized silhouette with a vent in the back for ease of movement. Cuffs can be adjusted with snaps.',_binary '\0',_binary '\0','Áo Khoác Dáng Dài',1471000,'ao-khoac-dang-dai-5',5),(6,'2024-10-30 19:54:14.638970','admin@gmail.com','2024-10-30 19:54:14.682483','admin@gmail.com',NULL,NULL,'- Made from lightweight nylon. With padding inside.\n- Raglan sleeves for a snug fit.\n- Snap and slide fastener closure hidden under a tab. With pockets.\n- Works as outerwear or as an inner layer under a coat.',_binary '\0',_binary '\0','PUFFTECH Áo Khoác Dáng Dài',1962000,'pufftech-ao-khoac-dang-dai-6',5),(7,'2024-10-30 20:02:50.067704','admin@gmail.com','2024-10-30 20:02:50.114526','admin@gmail.com',NULL,NULL,'- High-performance padding made with hollow yarn traps the air for extra warmth.\n- Water-repellent finish protects against light rain. *The fabric is coated with a water-repellent agent so the effect lasts. The finish is not permanent.\n- Special double-weave fabric keeps the padding in place and blocks out wind and light rain.\n- Rounded hem and drop shoulder details make it easy to wear around town.\n- Hand-washable for easy care.',_binary '\0',_binary '\0','PUFFTECH Áo Khoác Chần Bông | Có Mũ',1471000,'pufftech-ao-khoac-chan-bong-co-mu-7',6),(8,'2024-10-30 20:10:31.727873','admin@gmail.com','2024-10-30 20:10:31.753213','admin@gmail.com',NULL,NULL,'- High-performance hollow fiber padding traps air for warmth.\n- Outer fabric made of ultra-fine fibers provides a soft touch.\n- Collar fastens with snap buttons.\n- Soft stretch tape inside the cuffs makes it easy to roll up the sleeves.\n- Comes with a storage pouch for easy carrying.\n- Quick-drying and hand-washable for easy care.\n- Perfect as an inner or outer layer for protection against the cold.\n- Water-repellent finish protects against light rain. *The fabric is coated with a water-repellent agent so the effect lasts. The finish is not permanent.\n- Anti-static lining.',_binary '\0',_binary '\0','PUFFTECH Áo Khoác Chần Bông Gọn Nhẹ',1275000,'pufftech-ao-khoac-chan-bong-gon-nhe-8',6),(9,'2024-10-30 20:21:32.089476','admin@gmail.com','2024-10-30 20:21:32.141951','admin@gmail.com',NULL,NULL,'- Warm premium down with a fill power of 750+.* *Measured by the IDFB method\n- Hood and cushioned collar for extra warmth around the neck.\n- Water-repellent finish protects against light rain. Fluorine-free water repellency. *The finish is not permanent.\n- Front waterproof fastener keeps rainwater out.\n- Warm, fleece-lined pockets.\n- Updated with a cocoon silhouette for a more refined design.\n- High-performance down with improved wind resistance and water repellency.\n- Seamless design for extra warmth.',_binary '\0',_binary '\0','Seamless Down Áo Parka',2944000,'seamless-down-ao-parka-9',7),(10,'2024-10-30 20:32:58.639108','admin@gmail.com','2024-10-30 20:32:58.675628','admin@gmail.com',NULL,NULL,'- Premium down with a fill power of 750.* *Measured by the IDFB method\n- Matte fabric for a natural look.\n- Water-repellent finish protects against light rain. *The fabric is coated with a water-repellent agent so the effect lasts. The finish is not permanent.\n- Cropped length pairs well with any bottoms or dresses.',_binary '\0',_binary '\0','Áo Phao Gi Lê Dáng Lửng',1275000,'ao-phao-gi-le-dang-lung-10',7);
